Trust Me, I'm a Doctor

Health-Medical Documentary hosted by Michael Mosley and Saleyha Ahsan and Gabriel Weston and Chris van Tulleken, published by BBC in 2013 - English narration


Information
------------------------------

The series that cuts through the confusing adverts, headlines and health advice to provide information you need to live healthily.
Part 1.
Can you be fat and fit? Could you improve your health by staying in bed longer? Should we all be taking an Aspirin pill to help us live longer? Michael Mosley is joined by a team of doctors who use their expertise to get to the bottom all those health claims.Dr Chris van Tulleken examines what diseases lurk on Britain's hands; Dr Saleyha Ahsan has some simple tips that could allow you to save a life; and surgeon Gabriel Weston witnesses brain surgery without a knife.
Part 2.
Are vitamin pills money down the loo? Should we all be signing up to private health checks? Will antibiotics cure back pain? And does getting cold make you catch one? Michael Mosley and the team of doctors are in Chester to test an extraordinary idea, that simply standing up more could transform our health. Gabriel Weston witnesses surgical history as she attends a womb transplant, Saleyha Ahsan demonstrates how to stop someone choking and Michael asks if he should be taking statins.
Part 3.
Michael Mosley and the team of doctors are in Lancaster to test if trees could be the answer to a hidden health threat that kills 29,000 people a year - air pollution. The team also finds out the answers to many health questions. Is there a cure for hay fever? Are smoothies good for you? Is coffee bad for you? Will Probiotic yoghurts keep you healthy? And should more people be taking HRT? Also in this episode, Gabriel Weston is tracking down a novel cure to migraines that been found in a beauty clinic and Saleyha Ahsan is on a mission to teach us all how to revive a drowning casualty.

